import React from 'react';

export default function NavBar(props){
    const viewNames = ['cases', 'deaths', 'recovered']

    return(
        <nav>

            {viewNames.map((viewName) =>(

                <button type="button" className="btn btn-primary btn-lg" id="nav-btns" key={viewName} className="ui secondary button" onClick={()=> props.onSelectView(viewName)}>
                    {viewName}</button>

            ))}

        </nav>

    )

}
